import React from 'react';
import TextField from './TextField';
import SelectField from './SelectField';

function LocationDetails(props) {
    return (
        <div id="locationDetails">
            <span className="divTitle">city: </span><TextField type={props.textField} />
            <span className="divTitle">State: </span><TextField type={props.textField} />
            <span className="divTitle">Postal Code: </span><TextField type={props.textField} />
            <span className="divTitle">country: </span><div className="selectField">
                <SelectField invoiceDetails={props.countryField} />
            </div>
        </div>
    )
}
export default LocationDetails
